import { useState } from 'react';
import MyButton from './components/UI/button/MyButton';
import ReviewWindow from './components/ReviewWindow';
import data from './components/data/data.json'
import './styles/App.css';
import About from './components/About';
import Review from './components/Review';


function App() {
  const [modalWindow1, setModalWindow] = useState(false);
  const [count, setCount] = useState('0');
  const [count1, setConst1] = useState('1')
  console.log(data[0].photo)

  return (
    <div className="App">
      <ReviewWindow modalWindow={modalWindow1} setModal={setModalWindow} />
      <div className="head">
        <MyButton visible={false} style={{ position: "absolute", width: "227px", left: "1133px", top: "32px" }}>Панель управления</MyButton>
      </div>
      <div className="line"></div>
      <div className="body">
        <h1 className="welcome">Добро пожаловать в Академию!</h1>
        <img className='photo' />
        <About />
        <div className="reviews-block">
          <h2 className="reviews">Отзывы</h2>
          <MyButton visible={true} onClick={() => setModalWindow(true)}>Добавить отзыв</MyButton>
          <Review name={data[count].name} style={{position: "absolute", width: "519px", height: "279px", left: "80px", top: "182px", background: "#F5F5F5", "border-radius": "2px"}} />
          <Review name={data[count1].name} style={{position: "absolute", width: "519px", height: "279px", left: "623px", top: "182px", background: "#F5F5F5", "border-radius": "2px"}} />
        </div>
      </div>
      <div className="footer"></div>
    </div>
  )
}

export default App;
